import React, {useState} from "react";
import LoginForm from "./Component/LoginForm";
import AddElement from "./Component/AddElement";
import listElements from "./Component/listElements";
import Element from "./Component/Element";

function App() {
  const [elements, setElements] = useState([
          {
              id: 1,
              title:'Premier article',
              content:'Récupérer cours React bla bla bla bla',
              complete: false
          },
          {
              id: 2,
              title:'Faire exercice React',
              content:'Faire exercice React bla bla bla',
              complete: false
          }
      ]
  );

  return (
      <>
          <LoginForm />
          <AddElement setElements={setElements}/>
          <h2>Tous les blogs</h2>
          <listElements />
      </>
  );
}

export default App;
